import React from 'react';
import { useState, useEffect } from 'react';
import { Navbar, NavbarBrand, NavbarNav, NavbarItem, NavbarToggler, NavbarCollapse, Container } from '@nextui-org/react';
const Nav = () => {
    const [active, setActive] = useState('');

    useEffect(() => {
        const path = window.location.pathname;
        setActive(path.slice(1));
    }, []);

    {/*
        <li className={active === 'chi_e' ? 'active' : ''}><a href="/chi_e">Chi sono</a></li>
        <li className={active === 'cosa_ha_fatto' ? 'active' : ''}><a href="/cosa_ha_fatto">Portfolio</a></li>
        <li className={active === 'curriculum' ? 'active' : ''}><a href="/curriculum">Curriculum</a></li>
    */}
    return (
        <Navbar>
            <NavbarBrand>
                <p className="font-bold text-inherit">ACME</p>
            </NavbarBrand>
            <NavbarContent className="hidden sm:flex gap-4" justify="center">
                <NavbarItem>
                    <Link color="foreground" href="#">
                        Features
                    </Link>
                </NavbarItem>
                <NavbarItem isActive>
                    <Link href="#" aria-current="page">
                        Customers
                    </Link>
                </NavbarItem>
                <NavbarItem>
                    <Link color="foreground" href="#">
                        Integrations
                    </Link>
                </NavbarItem>
            </NavbarContent>
            <NavbarContent justify="end">
                <NavbarItem className="hidden lg:flex">
                    <Link href="#">Login</Link>
                </NavbarItem>
                <NavbarItem>
                    <Button as={Link} color="primary" href="#" variant="flat">
                        Sign Up
                    </Button>
                </NavbarItem>
            </NavbarContent>
        </Navbar>

    )
};



export default Nav;
